css:
@-moz-document domain(www.nitrotype.com)
{
Body {
    background: none;
}
html {
    background: fixed url(https://imgix.bustle.com/uploads/getty/2020/4/25/ba433b45-1ae3-4757-a7bb-239cf56d3fd5-getty-1218538177.jpg?w=1020&h=574&fit=crop&crop=faces&auto=format%2Ccompress), #001d45;
    background-size: 100%;
}
.card--grit {
    background: url(https://wallpaperaccess.com/full/1314202.jpg);
    background-size: 100%;
    opacity: 100%
}
.bg--gradient {
    background: none;
    background-color: #2c1469
}
.theme--pDefault .profile-bg {
    background: url("https://i.pinimg.com/originals/a8/c3/b9/a8c3b988f9621fa91f7c22e647b38136.png") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
}
.theme--pDefault .profile-bgHead {
    background: url("https://i.pinimg.com/originals/a8/c3/b9/a8c3b988f9621fa91f7c22e647b38136.png") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
}

.theme--pDefault.is-gold .profile-bg {
    background: url("https://i.pinimg.com/originals/a8/c3/b9/a8c3b988f9621fa91f7c22e647b38136.png") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
}
.dash-copyContainer {
    background: #322849;
}
.dash-copy {
    color: #bbacd4;
    font-size: 25px
}
.footer.cell.cell--s {
    background: url(https://wallpaperaccess.com/full/1314202.jpg);
    background-size: 50%
}
.footer-copyright {
    background: none;
    background-color: #2c1f4c
}
.footer-card.card.card--c.card.card-shadow {
    background-color: #3d2650
}
.nav {
    background: url(https://wallpaperaccess.com/full/1314202.jpg);
    background-size: 40%;
}
.theme--pDefault .profile-title {
    color: #6748b2
}
.theme--pDefault .profile-levelNum {
    color: #6748b2;
    text-shadow: 0 2px 2px rgba(2, 2, 2, 0.25)
}
.theme--pDefault .profile-body {
    color: #45467e
}
.raceResults-title--main {
    color: #fff;
    background: #5448b2
}
.raceResults-title--main, .raceResults-title--main:after {
    color: #fff;
    background: #5448b2
}
::selection {
    background: #5448b2;
    color: #fff  
}
.raceResults-title--place, .raceResults-title--place:after {
    color: #5448b2;
    background: #fff;
}
.raceResults-rewards {
    background: url(https://wallpaperaccess.com/full/1314202.jpg);
    background-size: 100%
}
.tc-emerald {
    color: #a394dc
}
.card--season {
    background: url(https://scx2.b-cdn.net/gfx/news/hires/2019/galaxy.jpg);
    background-size: 100%
}
}
